# 1372. Longest ZigZag Path in a Binary Tree
# Medium
# Topics
# premium lock icon
# Companies
# Hint
# You are given the root of a binary tree.
#
# A ZigZag path for a binary tree is defined as follow:
#
# Choose any node in the binary tree and a direction (right or left).
# If the current direction is right, move to the right child of the current node; otherwise, move to the left child.
# Change the direction from right to left or from left to right.
# Repeat the second and third steps until you can't move in the tree.
# Zigzag length is defined as the number of nodes visited - 1. (A single node has a length of 0).
#
# Return the longest ZigZag path contained in that tree.
#
#
#
# Example 1:
#
#
# Input: root = [1,null,1,1,1,null,null,1,1,null,1,null,null,null,1]
# Output: 3
# Explanation: Longest ZigZag path in blue nodes (right -> left -> right).
# Example 2:
#
#
# Input: root = [1,1,1,null,1,null,null,1,1,null,1]
# Output: 4
# Explanation: Longest ZigZag path in blue nodes (left -> right -> left -> right).
# Example 3:
#
# Input: root = [1]
# Output: 0
#
#
# Constraints:
#
# The number of nodes in the tree is in the range [1, 5 * 104].
# 1 <= Node.val <= 100

from typing import List, Optional


# Definition for a binary tree node.
class TreeNode:
    def __init__(self, val=0, left=None, right=None):
        self.val = val
        self.left = left
        self.right = right

def build_tree_recursive(nodes: List[int], i: int, n: int) -> Optional[TreeNode]:
    # base case return None
    root = None

    # create node with value nodes[i] if valid
    if i < n and nodes[i] is not None:
        root = TreeNode(nodes[i])
        root.left = build_tree_recursive(nodes, 2*i + 1, n)
        root.right = build_tree_recursive(nodes, 2*i + 2, n)

    return root

def build_tree_queue(nodes: List[int]) -> Optional[TreeNode]:
    root = None
    queue = []
    if len(nodes) > 0:
        root = TreeNode(nodes[0])
        queue.append(root)

    i = 1
    n = len(nodes)
    while len(queue) > 0:
        for _ in range(len(queue)):
            node = queue.pop(0)
            if i < n and nodes[i] is not None:
                node.left = TreeNode(nodes[i])
                queue.append(node.left)
            i += 1

            if i < n and nodes[i] is not None:
                node.right = TreeNode(nodes[i])
                queue.append(node.right)
            i += 1

    return root


class Solution:
    def longestZigZag(self, root: Optional[TreeNode]) -> int:

        return


class mySolution:
    def longestZigZag(self, root: Optional[TreeNode]) -> int:
        # O(nodes), recursively find longest zigzag path starting at each node
        # recursively explore children also

        def dfs(root: Optional[TreeNode], length: int, dir: int) -> int:
            # base case
            if root is None:
                return length - 1

            # compare paths
            if dir == -1:
                continued = dfs(root.left, length + 1, dir * -1)
                started = dfs(root.right, 1, -1)
            else:
                continued = dfs(root.right, length + 1, dir * -1)
                started = dfs(root.left, 1, 1)

            # left = dfs(root.left, 1, 1)
            # right = dfs(root.right, 1, -1)

            length = max(continued, started)
            return length

        return dfs(root, 0, 1)


